SAVE_NUM1PRO PROC
;++++++++++++++++++
MOV TEMPDB1, AL
;++++++++++++++++++
XOR BX, BX
MOV BL, TEMPDB1
PUSH BX ;Guardara el numero
;++++++++++++++++++
MOVE_CURSOR 31, 7
SCREEN_CHAR_PRINT AL
;++++++++++++++++++
SUB TEMPDB1, 30H
MOV BL, TEMPDB1
ADD NUM1, BL
CALL RESET_TEMPS
INC COUNT1
DEC COUNTPOSITION
INC COUNTSIZE
CALL CLEARBUFFER
RET
SAVE_NUM1PRO ENDP
